Boo! 120 new Halloween-themed griddlers! No tricks!
Trick or treat? Nope! No tricks here! Instead, how about 120 new Halloween-themed levels of all new griddlers? Now that's a real treat! Boo! Here's your chance for a memorable Halloween night! Afraid of ghosts? Can you get tons of tasty candies faster than your friends? Fill &amp; Cross Trick or Treat 2 features 120 unique levels, 6 locations, more than 10 hours of gameplay, as well as new and improved controls. Complete special tasks to get trophies and make the game even more fun. Excellent music, fun trophies and an atmosphere that's truly Halloween in spirit! Boo! Guess all the pictures and fool an old witch!
